import axios from 'axios';
import { wordsUrl } from '../urls'; 

export const fetchWords = (id) => {
  return axios.get(wordsUrl(id), { withCredentials: true })
    .then(function (response) {
      return response;
    })
    .catch(function (error) {
      console.log(error);
    });
}
